fn printFunc(f:u16){
    println!("N: {}", format!("{:01$x}",f,8));
    println!("4|0123");
    println!("------");
    let mut rar: Vec<Vec<u8>> = Vec::new();
    for i1 in 0..4 {
        let mut blah: Vec<u8> = Vec::new();
        for i2 in 0..4 {
            blah.push(get_2bit_at(f,i1*4+i2));
        }
        rar.push(blah);
    }
    for i1 in 0..4 {
        print!("{}|", i1);
        for i2 in 0..4 {
            print!("{}",rar[i1][i2]);
        }
        println!("");
    }
}
fn printFuncNum(f:u16){
    println!("N: {}", format!("{:01$x}",f,8));
}
fn printFuncNumNoNewLine(f:u16){
    print!("0x{} , ", format!("{:01$x}",f,8));
}

