//compose uf f1 f2 -> (\x y -> uf(f1(x,y),f2(x,y)))
fn comp(uf: u16,f1:u16,f2:u16) -> u16 {
    let mut ret: u16 = 0;
    let mut f1p: u8 = 0;
    let mut f2p: u8 =0;
    let mut ufp: u8 =0;
    let four:u16 = 4;
    for i in 0..16 {
        f1p = get_2bit_at(f1,i);
        //println!("f1p {:x}", f1p);
        f2p = get_2bit_at(f2,i);
        //println!("f2p {:x}", f2p);
        ufp = get_2bit_at(uf,f1p*4+f2p);
        //println!("ufp {:x}", ufp);
        let computation = (((ufp as u16)*four.pow((i) as u16)) as u16);
        ret = ret + computation;
        //println!("ufp*4^^i {}", format!("{:01$x}",computation,8));
        //println!("ret {}", format!("{:01$x}",ret,8));
    }
    ret
}

//0123
//4567
//89ab
//cdef

fn get_2bit_at(input: u16, n: u8) -> u8 {
    (get_bit_at(input,2*n+1) as u8)*2 + (get_bit_at(input,2*n) as u8)
}

fn get_bit_at(input: u16, n: u8) -> bool {
    if n < 32 {
        input & (1 << n) != 0
    } else {
        false
    }
}

fn transpose(f:u16) -> u16 {
    comp(f,bg,ag)
}

fn fng(uf:u16,a:u16,b:u16) -> u16 {
    rot(uf,b,comp(uf,rot(uf,ag,a),rot(uf,bg,a)))
}

fn rot(uf:u16,f:u16,n:u16) -> u16{
    if n==0 {
        f
    }else{
        comp(uf,rot(uf,f,n-1),rot(uf,f,n-1))
    }
}

//not built on comp
//changes the non-diagnal of a function
fn changeNotDiag(f:u16, n:u8) -> u16 {
    let mut ret: u16 = 0;
    for i in 0..16 {
        if (i%5==0) {
            ret = ret+(get_2bit_at(f,i) as u16)*(4u16.pow(i as u16)); 
        }else{
            ret = ret+(n as u16)*(4u16.pow(i as u16));
        }
    }
    ret
}

enum InOGLG<T>{
    IsInOGLG(T),
    TimedOut(T),
    IsSubSet(T)
}

//funcs must be sorted, depth controls size of funcs
//oglg must be sorted
fn checkInOGLG(func:u16, funcs:Vec<u16>, oglg: &Vec<u16>, depth: usize) -> InOGLG<Vec<u16>>{
    if funcs.len()>1000 {
        //println!("{}",funcs.len());
    }
    let mut inoglg = false;
    let mut i =0;
    while (!inoglg) & (i<funcs.len()) {
        let r = oglg.binary_search(&funcs[i]);
        inoglg = match r {
            Ok(_) => true,
            _ => false
        };
        i = i + 1;
    }
    if inoglg {
        InOGLG::IsInOGLG(funcs)
    } else {
        if funcs.len()<=depth {
            let mut combs = Vec::new();
            combs.extend(&funcs);
            for uf in &funcs { 
                for f1 in &funcs { 
                    for f2 in &funcs {
                        let curcomp = comp(*uf,*f1,*f2);
                        let s = combs.binary_search(&curcomp);
                        match s {
                            Ok(_) => {},
                            Err(n) => { 
                                combs.insert(n,curcomp);
                            }
                        }
                    }
                }
            }
            combs.dedup();
            if &combs.len()==&funcs.len() {
                //printFuncNum(func);
                //println!("is a subset {}", funcs.len());
                InOGLG::IsSubSet(funcs)
            } else {
                checkInOGLG(func, combs,oglg,depth)
            }
        } else {
            InOGLG::TimedOut(funcs)
        }
    }
}

fn findOGLG(funcs:Vec<u16>, oglg:Vec<u16>, depth:usize) -> Vec<u16> {
    let mut newOglg:Vec<u16> = Vec::new();
    &newOglg.extend(&oglg);
    for f in funcs {
        if goodDiag(f) {
            //printFuncNum(f);
            let checkRes = checkInOGLG(f, vec![f,ag,bg], &newOglg, depth);
            match checkRes {
                InOGLG::IsInOGLG(_) => {
                    //printFuncNum(f);
                    //println!("in oglg");
                    let r = newOglg.binary_search(&f);
                    match r {
                        Ok(_) => {},
                        Err(n) => {
                            &newOglg.insert(n,f);
                        }
                    }
                },
                _ => {}
            }
        } else {
        }
    }
    newOglg
}


fn parFindOGLG(oglg:Vec<u16>, depth:usize) -> Vec<u16> {
    let (tx,rx) = mpsc::channel();
    for i1 in 0..16 {
        let tx = tx.clone();
        let oglg = oglg.clone();
        let offset = 0*4u16.pow(10);
        thread::spawn(move || {
            let noglg = 
                findOGLG(
                    ((i1*4u16.pow(10)+offset)..((i1+1)*4u16.pow(10)+offset))
                        .collect::<Vec<u16>>()
                    , oglg
                    , 36
                );
            tx.send(noglg).unwrap();
        });
    }
    let mut noglg: Vec<u16> = Vec::new();
    for i in 0..16 {
        noglg.extend(rx.recv().unwrap());
    }
    noglg.sort();
    noglg.dedup();
    noglg
}

fn goodDiag(f:u16) -> bool {
    !(get_2bit_at(f,0)==0 || get_2bit_at(f,5)==1 || get_2bit_at(f,10)==2 || get_2bit_at(f,15)==3)
}
